module.exports = "<app-header></app-header>\r\n<div class=\"container-fluid margin-top-80px\">\r\n    <div class=\"row upper-container\">\r\n        <div class=\"col-md-6 col-md-offset-6 agencies-box\">\r\n            <h1><span class=\"highlight\">WE LIVE FOR THE STORIES YOU LOVE TO CREATE.</span></h1>\r\n            <!--<h1 class=\"title\"><span class=\"highlight\">We live for the stories you love to create.</span></h1>-->\r\n            <br>\r\n            <p class=\"lead\">\r\n                That’s why we support individual creators who strive to grow and strengthen the communities they’ve worked so hard to create. Discover how our vibrant global community is actively collaborating with brands to create one of kind, user generated advertising experiences.From the world’s most powerful influencer technology to campaign development, see how our we can help you take your Brand or Agency content campaigns to the next level.\r\n            </p>\r\n            <p>\r\n                <!-- <a data-toggle=\"modal\" class=\"button\" routerlink=\"/register\">Get Started for FREE</a> -->\r\n                <button class=\"button pull-right\"><a routerlink=\"/register\" href=\"/register\">Get Started for FREE</a></button>\r\n\r\n            </p>\r\n        </div>\r\n    </div>\r\n\r\n</div>\r\n\r\n<div class=\"container\">\r\n\r\n<ul class=\"nav nav-tabs agencies-tabs\" role=\"tablist\">\r\n    <li  class=\"active\">\r\n        <a  aria-controls=\"home\" role=\"tab\" href=\"#build\" data-toggle=\"tab\" aria-expanded=\"true\">\r\n        <i class=\"fa fa-desktop\"></i><br>\r\n        <span class=\"textwrap\">Build Your Page</span>\r\n        </a>\r\n\r\n    </li>\r\n    <li role=\"presentation\" class=\"\"><a href=\"#find\" aria-controls=\"profile\" role=\"tab\" data-toggle=\"tab\" aria-expanded=\"false\">\r\n        <i class=\"fa fa-search-plus\"></i><br>\r\n        <span class=\"textwrap\">Find Great Influencers</span></a>\r\n    </li>\r\n    <li role=\"presentation\" class=\"\"><a href=\"#organize\" aria-controls=\"settings\" role=\"tab\" data-toggle=\"tab\" aria-expanded=\"false\">\r\n        <i class=\"fa fa-sitemap\"></i><br>\r\n        <span class=\"textwrap\">Organize Your Influencers</span></a>\r\n    </li>\r\n    <li role=\"presentation\" class=\"\"><a href=\"#apply\" aria-controls=\"messages\" role=\"tab\" data-toggle=\"tab\" aria-expanded=\"false\">\r\n        <i class=\"fa fa-angellist\"></i><br>\r\n\r\n        <span class=\"textwrap\">Let Them Apply</span></a>\r\n    </li>\r\n    <li role=\"presentation\" class=\"\"><a href=\"#together\" aria-controls=\"settings\" role=\"tab\" data-toggle=\"tab\" aria-expanded=\"false\">\r\n        <i class=\"fa fa-handshake-o\"></i><br>\r\n        <span class=\"textwrap\">Work Together</span></a>\r\n    </li>\r\n</ul>\r\n\r\n\r\n\r\n    <div class=\"tab-content padding-t-b-10px\">\r\n        <div role=\"tabpanel\" class=\"tab-pane active\" id=\"build\">\r\n            <div class=\"row\" >\r\n                <div class=\"col-md-6 col-md-push-6\">\r\n                    <img class=\"happy\" src=\"../../assets/img/images/agencies/Build-Your-Own-Page.png\" alt=\"Agency page build 1c5f7604d73fd0fac6cdaf20a99a31624e98aebb97852e8f2b0b75215dca871c\">\r\n                </div>\r\n                <div class=\"col-md-6 col-md-pull-6\">\r\n                    <div class=\"details\">\r\n                        <h5 class=\"heading-2\">Build Your Page</h5>\r\n                        <p>Our global community is made up of creative content creators from almost every genre, interests, and background you could possibly imagine. From fitness to food art, there’s a space for you here to connect with brands who are just as passionate as you are</p>\r\n                        <!--<p>An Agency Page lets you show off your clients to the world and possibly attract new ones. Whether it be your roster of modeling or influencer talent or the companies you run influencer campaigns for, it’s always good to let the world know who you work with. Agency Pages are public so you can share them on your social channels to recruit more clients.</p>-->\r\n                        \r\n                        <p><a class=\"button hidden-xs\" href=\"#find\" aria-controls=\"profile\" role=\"pill\" data-toggle=\"pill\" aria-expanded=\"false\">Next</a></p>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div role=\"tabpanel\" class=\"tab-pane\" id=\"find\">\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6 col-md-push-6\">\r\n                    <img class=\"happy\" src=\"../../assets/img/images/agencies/Find-Great-Influencers.png\" alt=\"Business page search fce822ec1aa72e1b389b6c1e65897ed924d6e2b2f0ea2736491c64bdb811a0a0\">\r\n                </div>\r\n                <div class=\"col-md-6 col-md-pull-6\">\r\n                    <div class=\"details\">\r\n                        <h5 class=\"heading-2\">Find Great Influencers</h5>\r\n                        <p>Whether you’re looking for new talent to represent or influencers to collaborate with on your campaigns, our world-class search tools will narrow down our 50K influencers to a small group that you think might be a good fit for your project. Influencers build their own pages and show off who they have worked with. Find them by location, category, brands they have worked with and other advanced search criteria.</p>\r\n                        \r\n                        <!-- <p><a class=\"button hidden-xs\" href=\"#landingpage-tabs\">Next</a></p> -->\r\n                        <p><a class=\"button hidden-xs\" href=\"#organize\" aria-controls=\"profile\" role=\"pill\" data-toggle=\"pill\" aria-expanded=\"false\">Next</a></p>\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div role=\"tabpanel\" class=\"tab-pane\" id=\"organize\">\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6 col-md-push-6\">\r\n                    <img class=\"happy\" src=\"../../assets/img/images/agencies/Organize.png\" alt=\"Business page list c3a0393629d2ab5bcb23cc61622cefed1de48f4a0147b3611cdcd70acca10d7d\">\r\n                </div>\r\n                <div class=\"col-md-6 col-md-pull-6\">\r\n                    <div class=\"details\">\r\n                        <h5 class=\"heading-2\">Organize Your Influencers</h5>\r\n                        <p>Organize potential influencers or clients into lists. Group them by location, category or even their audience size. You can share these lists with your team members and easily move influencers between lists as you narrow down candidates for your campaign.</p>\r\n                        \r\n                        <!-- <p><a class=\"button hidden-xs\" href=\"#landingpage-tabs\">Next</a></p> -->\r\n                        <p><a class=\"button hidden-xs\" href=\"#apply\" aria-controls=\"profile\" role=\"pill\" data-toggle=\"pill\" aria-expanded=\"false\">Next</a></p>\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div role=\"tabpanel\" class=\"tab-pane\" id=\"apply\">\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6 col-md-push-6\">\r\n                    <img class=\"happy\" src=\"../../assets/img/images/agencies/let-them-apply.png\" alt=\"Business page application 4dd2776967bd37196824d937a2f864b9143a48b88e1ce5b94eba22db8e8f7613\">\r\n                </div>\r\n                <div class=\"col-md-6 col-md-pull-6\">\r\n                    <div class=\"details\">\r\n                        <h5 class=\"heading-2\">Let Them Apply</h5>\r\n                        <p>If you don’t want to spend time reaching out influencers, you can set up a campaign and let them apply to you. You can set application criteria such as followers, location, rate information and much more. Most campaigns receive 60-100 qualified inbound candidates in the first week.</p>\r\n                        \r\n                        <!-- <p><a class=\"button hidden-xs\" href=\"#landingpage-tabs\">Next</a></p> -->\r\n                        <p><a class=\"button hidden-xs\" href=\"#together\" aria-controls=\"profile\" role=\"pill\" data-toggle=\"pill\" aria-expanded=\"false\">Next</a></p>\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n        <div role=\"tabpanel\" class=\"tab-pane\" id=\"together\">\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6 col-md-push-6\">\r\n                    <img class=\"happy\" src=\"../../assets/img/images/agencies/Work-Together.png\" alt=\"Agency page together 0f780c68da81e855e8502f7ae993c2c945c37337b891589d34b45534e13eabe1\">\r\n                </div>\r\n                <div class=\"col-md-6 col-md-pull-6\">\r\n                    <div class=\"details\">\r\n                        <h5 class=\"heading-2\">Work Together</h5>\r\n                        <p>influencexpai allows your team to work together. Your team can build and share lists, manage your clients’ profiles for them and even apply to or manage campaigns on your clients’ behalf. No more logging in and out of Instagram accounts till you’re blue in the face, our team management system lets you jump between profiles easily. </p>\r\n\r\n                        <!-- <p><a data-toggle=\"modal\" class=\"button\" routerlink=\"/register\">Sign-Up Free Now</a></p> -->\r\n\r\n                        <!-- <p><a data-toggle=\"modal\" class=\"button\" href=\"#claim-modal\">Sign-Up Free Now</a></p> -->\r\n                        <button class=\"button pull-right\"><a routerlink=\"/register\" href=\"/register\">Sign-Up FREE</a></button>\r\n\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n<!-- <app-footer></app-footer> -->"

