module.exports = "<app-header></app-header>\r\n<div class=\"blog-wrapper\">\r\n\r\n  <section class=\"title-top-bg\">\r\n    <div class=\"container\">\r\n      <h1>Brands</h1>\r\n    </div>\r\n  </section>\r\n\r\n  <section class=\"marketing\">\r\n  <div class=\"container\">\r\n      <div class=\"row brand-outer\">\r\n        <div class=\"left\">\r\n          <div class=\"\">\r\n            <img src=\"../../assets/img/images/brand/Marketing.jpg\" alt=\"\">\r\n          </div>\r\n        </div>\r\n        <header class=\"right\">\r\n          <div class=\"ico\"><img src=\"../../assets/img/images/brand/Marketing.png\" alt=\"\"></div>\r\n          <h2 class=\"s_brand_heading\">Marketing for a new generation</h2>\r\n          <p>Want millions of people to learn about your brand? You’re in the right place. Creators are this generation's storytellers, telling product stories in a way that no one else can. Their audience trusts them and looks to them for advice on the newest products, brands and services.</p>\r\n        </header>\r\n      </div>\r\n    <div class=\"row\">\r\n      <article class=\"article col-md-4 col-sm-4 col-xs-12\" style=\"transition-delay: 0ms;\">\r\n        <div class=\"ico\"><img src=\"../../assets/img/images/brand/budget.png\" alt=\"\"></div>\r\n        <h3>Flexible budgets</h3>\r\n        <p>Signing up for FameBit is free and since you set your content budget, you’re in charge of how much you spend. Some brands spend tens of thousands per campaign, but you can start as low as $100.</p>\r\n      </article>\r\n      <article class=\"article border-l-r col-md-4 col-sm-4 col-xs-12\" style=\"transition-delay: 250ms;\">\r\n        <div class=\"ico\"><img src=\"../../assets/img/images/brand/Tools.png\" alt=\"\"></div>\r\n        <h3>Tools powered by data</h3>\r\n        <p>Finding the right creators is key. With advanced campaign targeting and proposal filtering, you can target creators who have the audience and engagement to drive results for your brand.</p>\r\n      </article>\r\n      <article class=\"article col-md-4 col-sm-4 col-xs-12\" style=\"transition-delay: 500ms;\">\r\n        <div class=\"ico\"><img src=\"../../assets/img/images/brand/Brand-Safe.png\" alt=\"\"></div>\r\n        <h3>Brand safe content</h3>\r\n        <p>We’re here to protect your brand. View creator profiles, review content proposals, send your own talking points, and decide what content gets posted about your brand and when.</p>\r\n      </article>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n  <section class=\"brand\">\r\n    <div class=\"container\">\r\n      <h2>A few brands we work with</h2>\r\n      <ul class=\"logo-list\">\r\n        <li style=\"transition-delay: 0ms;\"><img src=\"../../assets/img/images/brand/logo01.png\" alt=\"canon\"></li>\r\n        <li style=\"transition-delay: 100ms;\"><img src=\"../../assets/img/images/brand/logo02.png\" alt=\"Activision\"></li>\r\n        <li style=\"transition-delay: 200ms;\"><img src=\"../../assets/img/images/brand/logo03.png\" alt=\"adidas\"></li>\r\n        <li style=\"transition-delay: 300ms;\"><img src=\"../../assets/img/images/brand/logo04.png\" alt=\"sony\"></li>\r\n        <li style=\"transition-delay: 400ms;\"><img src=\"../../assets/img/images/brand/logo05.png\" alt=\"conair\"></li>\r\n        <li style=\"transition-delay: 500ms;\"><img src=\"../../assets/img/images/brand/logo06.png\" alt=\"serioulsy\"></li>\r\n      </ul>\r\n    </div>\r\n  </section>\r\n\r\n  <section class=\"promotion\">\r\n    <div class=\"container\">\r\n      <div class=\"row promo-box\">\r\n        <!---->\r\n          <div class=\"col-lg-6 col-md-6\">\r\n            <h3 class=\"textcolor-violet\"><a routerLink=\"/pricing\" href=\"/pricing\">Branded content starting at $100</a></h3>\r\n            <p>Creators are ready to send you proposals. Start a campaign today for Free!</p>\r\n          </div>\r\n          <div class=\"col-lg-6 col-md-6 col-sm-12 sign-up-now-btn\">\r\n            <!-- <a routerLink='/register' rel=\"nofollow\" target=\"_self\" class=\"\">Sign up Now!</a> -->\r\n            <button class=\"button pull-right\"><a routerlink=\"/register\" href=\"/register\">Sign up Now!</a></button>\r\n\r\n          </div>\r\n      </div>\r\n    </div>\r\n  </section>\r\n</div>\r\n<!-- <app-footer></app-footer> -->"

